script: |
  super -f text -I q8438.spq | sort > q8438.out

inputs:
  - name: q8438.spq
    data: |
      SELECT DISTINCT - col1 * + ( + col0 ) AS col0 FROM tab0 (FORMAT parquet) WHERE col2 / col2 NOT BETWEEN + 95 + - col1 AND ( col1 + + col0 / 7 );
  - name: tab0

outputs:
  - name: q8438.out
    data: |
      -1215
      -1827
      -97
